import { Box, Typography, Button } from "@mui/material";
import React from "react";
import { Page } from "../types";

interface HeaderProps {
  setPage: (page: Page) => void;
}
export const Header: React.FC<HeaderProps> = ({ setPage }) => {
  return (
    <Box
      sx={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        width: "800px",
      }}
    >
      <Typography fontSize={"30px"}> Safety Manager </Typography>
      <Box
        sx={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          width: "375px",
        }}
      >
        <Button variant="outlined" onClick={() => setPage("Registration")}>
          {" "}
          Registration{" "}
        </Button>
        <Button variant="outlined" onClick={() => setPage("Students")}>
          {" "}
          Students{" "}
        </Button>
        <Button variant="outlined" onClick={() => setPage("Machines")}>
          {" "}
          Machinces{" "}
        </Button>
      </Box>
    </Box>
  );
};
